        // marginRight: theme.spacing(2),
    },
  })
);

export default () => {

    const classes = useStyles();

    return (
        <footer className={classes.footer} >
            <h3>Basic Symbols</h3>
            <h3>Variables</h3>
            <h3>Advanced</h3>
        </footer>
    )

}
